import React from 'react'
import ListingCard from './ListingCard'

function MyWatchList({onWatch, list}) {

  let watchListComponent;
  if (list) {
    watchListComponent = ist.map((house) => {
      return <ListingCard key={house.id} house={house} onWatch={onWatch} />
    });
  }

  console.log(list, onWatch, "is it working?")

  return (
    <div className="card">{watchListComponent}</div>
  )
}

export default MyWatchList

